	this.frame_8 = function() {
		MOTAS.setQuadState(
			this.btn166,
			'STRANGE FLAG',
			'It is a strange looking flag, I wonder what country has a flag like this...'
		);
		
		MOTAS.setFlavorText(
			this.btn167,
			'TABLE',
			'This table looks very robust and heavy. Wait, it IS very robust and heavy!'
		);
		
		MOTAS.setQuadState(
			this.btn169,
			() => void moCur.setBoth(myTranslation.mytxt25, 'outlook'),
			() => 
			{
				switch (this.pcState)
				{
					case "1":
						this.pcState = "0";
						break;
					case "4":
						this.pcState = "3";
						break;
					case "2":
						this.pcState = "3";
						break;
				}
				
				MOTAS.setText(myTranslation.mytxt42);
				moCur.setState("off");
				this.gotoAndStop("pcroom");
			},
			() => void moCur.setState('outlook'),
			() => void moCur.setState('off')
		);
		
		MOTAS.setFlavorText(
			this.btn170,
			myTranslation.mytxt55,
			() => 
			{
				let pcState = this.pcState;
				
				return pcState == "0" 
					? myTranslation.mytxt56
					: pcState == "1"
						? myTranslation.mytxt57 
					: pcState == "2"
						? myTranslation.mytxt57
					: pcState== "3"
						? myTranslation.mytxt56
					: pcState== "4" 
						? myTranslation.mytxt58
						: '';
			}
		);
			
		MOTAS.setFlavorText(
			this.btn171,
			myTranslation.mytxt55,
			myTranslation.mytxt56
		);
			
		MOTAS.setFlavorText(
			this.btn173,
			myTranslation.mytxt43,
			myTranslation.mytxt44
		);
			
		
		MOTAS.setQuadState(
			this.btn174,
			() => void moCur.setBoth(myTranslation.mytxt59, 'grab'),
			() => 
			{
				moCur.setState("grab");
				MOTAS.setText(myTranslation.mytxt60);
				this.pc.mouse.play();
			},
			() => void moCur.setState('hold'),
			() => void moCur.setState('off'),
		);
			
		MOTAS.setQuadState(
			this.btn176,
			() => void moCur.setBoth(myTranslation.mytxt50, 'grab'),
			() => 
			{
				moCur.setState("grab");
				let pcState = this.pcState;
				
				if (pcState == "1")
				{
					MOTAS.setText(myTranslation.mytxt51);
					moInv.unselect();
					this.pc.monitor.gotoAndStop(0);
					this.pc.desktop.gotoAndStop("off");
				}
				else if (pcState == "0")
				{
					MOTAS.setText(myTranslation.mytxt52);
					this.pcState = "1";
					this.pc.monitor.play();
					this.pc.desktop.gotoAndStop("on");
				}
				else if (pcState == "4")
				{
					MOTAS.setText(myTranslation.mytxt53);
					this.pcState = "3";
					this.pc.monitor.gotoAndStop(0);
					this.pc.desktop.gotoAndStop("off");
				}
				else if (pcState == "3")
				{
					MOTAS.setText(myTranslation.mytxt54);
					this.pcState = "4";
					this.pc.monitor.gotoAndPlay("bootup");
					this.pc.desktop.gotoAndStop("on");
				}
				else if (pcState == "2")
				{
					MOTAS.setText(myTranslation.mytxt51);
					this.pcState = "3";
					this.pc.monitor.gotoAndStop(0);
					this.pc.desktop.gotoAndStop("off");
				}
			},
			() => void moCur.setState('hold'),
			() => void moCur.setState('off'),
		);
		
		MOTAS.setQuadState(
			this.btn177,
			() => void moCur.setBoth(myTranslation.mytxt47, 'grab'),
			() => 
			{
				if (moInv.activeObject !== "floppy")
					MOTAS.setText(myTranslation.mytxt48);
				else
				{
					let pcState = this.pcState;
					if (pcState === "0")
						this.pcState = "3";
					else if (pcState === "1")
						this.pcState = "2";
					MOTAS.setText(myTranslation.mytxt49);
					moInv.unselect();
					moInv.remove('floppy');
				}
				moCur.setState("grab");
			},
			() => void moCur.setState('hold'),
			() => void moCur.setState('off'),
		);
	}
